# ///////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////// # 
 
def abnf000u00s00005_dados_sigom_001(icodbase, iidfilia, iqtddias, bprimdia):
    ddttmnow = datetime.now().date()
    ddataini = ddttmnow - timedelta(days = iqtddias)
    if bprimdia:    # Considera o primeiro dia da data encontrada em iqtddias
        ddataini = date(ddataini.year, ddataini.month, 1)
    # Debug (início)
    # print('======================================')
    # ianoatua = ddttmnow.year
    # imesatua = ddttmnow.month
    # print(ddataini)
    # print(ianoatua)
    # print(imesatua)    
    # print('======================================')
    # Debug (fim)
    sauxi001 = 'SELECT '
    # Campos das tabelas
    sauxi001 = sauxi001 + 'abnf01.dataoco, '          # [00] Data da ocorrência
    sauxi001 = sauxi001 + 'abnf02.prefvei, '          # [01] Prefixo do veículo com defeito
    sauxi001 = sauxi001 + 'abnf03.codolin, '          # [02] Código da linha
    sauxi001 = sauxi001 + 'abnf01.tabolin, '          # [03] Número da tabela da linha
    sauxi001 = sauxi001 + 'abnf04.dessoct, '          # [04] Tipo de ocorrência
    sauxi001 = sauxi001 + 'abnf05.dessded, '          # [05] Descrição da definição de GSD do SIGOM
    sauxi001 = sauxi001 + 'abnf06.dessdes, '          # [06] Descrição do subgrupo de GSD do SIGOM
    sauxi001 = sauxi001 + 'abnf07.dessdeg, '          # [07] Descrição do grupo de GSD do SIGOM
    sauxi001 = sauxi001 + 'abnf08.desscla, '          # [08] Descrição da classificação do SIGOM
    sauxi001 = sauxi001 + 'abnf07.dashboa  '          # [09] Descrição da classificação do SIGOM
    # ==> sauxi001 = sauxi001 + 'abnf01.erpdocu  '    # [15] Número do documento gerado pelo ERP da empresa
    # Tabela de ocorrências do SIGOM
    sauxi001 = sauxi001 + 'FROM       abnf_sigom_movimentacao_ocorrencias                         AS abnf01 '
    # Tabela de veículos (com defeito)
    sauxi001 = sauxi001 + 'INNER JOIN abnf_cadastro_veiculos                                      AS abnf02 '
    sauxi001 = sauxi001 + 'ON         abnf01.idvedef = abnf02.idveicu '     
    # Linhas
    sauxi001 = sauxi001 + 'INNER JOIN abnf_operacional_cadastro_linhas                            AS abnf03 '
    sauxi001 = sauxi001 + 'ON         abnf01.idolinh = abnf03.idolinh '
    # Tipo de ocorrência
    sauxi001 = sauxi001 + 'LEFT JOIN  abnf_sigom_cadastro_ocorrencias_tipos                       AS abnf04 '
    sauxi001 = sauxi001 + 'ON         abnf01.idsocti = abnf04.idsocti '  
    # GSD
    sauxi001 = sauxi001 + 'LEFT JOIN  abnf_sigom_cadastro_defeitos_definicoes                     AS abnf05 '
    sauxi001 = sauxi001 + 'ON         abnf01.idsdede = abnf05.idsdede '
    # GSD
    sauxi001 = sauxi001 + 'LEFT JOIN  abnf_sigom_cadastro_defeitos_subgrupos                      AS abnf06 '
    sauxi001 = sauxi001 + 'ON         abnf05.idsdesg = abnf06.idsdesg '
    # GSD
    sauxi001 = sauxi001 + 'LEFT JOIN  abnf_sigom_cadastro_defeitos_grupos                         AS abnf07 '
    sauxi001 = sauxi001 + 'ON         abnf06.idsdegr = abnf07.idsdegr '
    # Classificação
    sauxi001 = sauxi001 + 'LEFT JOIN  abnf_sigom_cadastro_classificacao                           AS abnf08 '
    sauxi001 = sauxi001 + 'ON         abnf01.idsclas = abnf08.idsclas '
    # Cláusula WHERE
    sauxi001 = sauxi001 + 'WHERE '
    sauxi001 = sauxi001 + 'abnf01.idfilia = ' + str(iidfilia) + ' AND ' # ==> Somente registros da filial
    sauxi001 = sauxi001 + 'abnf01.situreg != "C" AND '                  # ==> Somente registros não cancelados
    sauxi001 = sauxi001 + 'abnf01.dataoco >= "' + str(ddataini) + '" '  # ==> Somente registros com a data de ocorrência maior ou igual a data definida em "ddataini"
    # Ordenação
    sauxi001 = sauxi001 + 'ORDER BY abnf01.dataoco, abnf01.horaoco, abnf01.idsocor;'
    lsqlre01, iqtdre01 = abnf_database_executa_sql(icodbase, sauxi001)
    return lsqlre01, iqtdre01

